script: |
  super -f text -I q5603.spq | sort > q5603.out

inputs:
  - name: q5603.spq
    data: |
      SELECT tab2.col2 * + col1 FROM tab2 (FORMAT parquet) WHERE NOT ( - col0 + + col2 + - col1 ) IN ( col1 - tab2.col2 );
  - name: tab2

outputs:
  - name: q5603.out
    data: |
      1534
      646
      837
